/*!

=========================================================
* Argon Design System React - v1.1.0
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-design-system-react
* Copyright 2020 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-design-system-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
// nodejs library that concatenates classes
import classnames from "classnames";

// reactstrap components
import {
  Badge,
  Button,
  Card,
  CardBody,
  CardImg,
  FormGroup,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import DemoNavbar from "components/Navbars/DemoNavbar.js";
import CardsFooter from "components/Footers/CardsFooter.js";

// index page sections
import Download from "../IndexSections/Download.js";

class Landing extends React.Component {
  state = {};
  componentDidMount() {
    document.documentElement.scrollTop = 0;
    document.scrollingElement.scrollTop = 0;
    this.refs.main.scrollTop = 0;
  }
  render() {
    return (
      <>
        <DemoNavbar />

        <main ref="main">

          {/* Contactanos */}
          <div id="fh5co-contact" classnames="fh5co-contact-outer container-fluid">
            <Container>
              <h1 classnames="mb-5">CONT√ÅCTANOS</h1>
              <hr/>
              <Row classnames="p-3">
                <Col lg="8" classnames="wow fadeIn animated" data-wow-delay="0.25s">
                  <form id="contact-form" action="#">
                    <Row classnames="text-center">
                      <Col lg="6" classnames="mb-2 form-group">
                        <i classnames="fa fa-user icon"></i>
                        <Input type="text" classnames="form-control-alternative" placeholder="Ingrese su nombre"/>
                      </Col>
                      <Col lg="6" classnames="mb-2 form-group">
                        <i classnames="fa fa-envelope icon"></i>
                        <Input type="text" classnames="form-control" placeholder="Ingrese su email"/>
                      </Col>
                    </Row>
                    <div classnames="form-group mt-2">
                      <i classnames="fa fa-pencil-alt icon"></i>
                      <Input type="text" classnames="form-control-alternative" placeholder="Ingrese un asunto"/>
                    </div>
                    <div classnames="form-group mt-2">
                      <textarea type="text" rows="5" classnames="form-control-alternative md-textarea" placeholder="Redacte su mensaje"></textarea>
                    </div>
                      <Button type="submit" classnames="button" value="Enviar">Enviar</Button>
                  </form>
                </Col>
                <Col lg="4" classnames="wow fadeIn animated text-center  mt-0 mb-0" data-wow-delay="0.25s">
                  <img src="/img/breviLogo.PNG" alt="logo"/>
                  <Row classnames="mt-2 tarj">
                    <i classnames="fas fa-phone mt-2"></i>
                    <p>(054) 426610</p>
                    <i classnames="fas fa-envelope"></i>
                    <p>brevi@gmail.com</p>
                  </Row>
                </Col>
              </Row>

            </Container>


          </div>
          {/* End Contactanos */}

        </main>


        <CardsFooter />
      </>
    );
  }
}

export default Landing;
